import React, { Component } from 'react';
import { JobList } from './JobList';
import { loadJobs } from './requests';

export class JobBoard extends Component {
  render() {
    return (
      <div>
        <h1 className="title">Job Board</h1>
        <JobList jobs={loadJobs.data} />
      </div>
    );
  }
}
